#include <vector>
#include <iostream>
using namespace std;

class Solution {

    using iterator = vector<int>::const_iterator;

private:

long long factorial(long long n){
    long long result{0};
    for(int i=1; i <= n; ++i){
        result += i;
    }
    return result;
}
vector<int>::const_iterator isValid(vector<int>& sub_nums, iterator begin, iterator end){
    for(auto it = begin; it != end; ++it){
        if(it != end-1){
            if(*it == *(it+1)){
                return it;
            }
        }
    }
    return end;
}

long long caculate(vector<int>& nums, iterator begin, iterator end){
    long long result = 0;
    auto it = isValid(nums, begin, end);
    if(it == end){
        return factorial(end - begin);
    }
    result += caculate(nums, begin, it+1);
    result += caculate(nums, it+1, end);
    return result;
}
public:
    long long countAlternatingSubarrays(vector<int>& nums) {
        return caculate(nums, nums.cbegin(), nums.cend());
    }
};

